Mir baséieren zu Guangdong, China, starten vun 2008 un, verkaafen un den Inlandsmaart (37.00%), Nordamerika (18.00%), Südamerika (8.00%), Ostasien (8.00%), Nordeuropa (5.00%), Süden Asien (5.00%), Osteuropa (4.00%), Westeuropa (4.00%), Südostasien (4.00%), Mëtt Osten (2.00%), Südeuropa (2.00%), Zentralamerika (2.00%), Ozeanien ( 1,00%). Et sinn am Ganzen ongeféier 51-100 Leit an eisem Büro.
Ëmmer eng Pre-Produktioun Prouf virun Mass Produktioun;
Ëmmer Finale Inspektioun virum Versand;
Ultrasonic
... 
 iwwer 5000 integréiert.
Akzeptéiert Liwwerung Konditioune: FOB, EXW, Express Liwwerung;
Akzeptéiert Bezuelungswährung: USD, CNY;
Akzeptéiert Bezuelungstyp: T / T, PayPal, Western Union;
Sprooch geschwat: Englesch, Chinesesch
DYP ass en Hiersteller, eis Fabréck guttgeheescht vum ISO9001: 2008, ISO14001: 2004 Standard.
Jo, mir bidden ODM / OEM Servicer, mir kënnen d'Produkt no Äre Bedierfnesser personaliséieren, no geschate vun eisem R&D Team, Mir kënnen de Produit bauen deen Dir braucht op Basis
...
 mir kënnen Iech zu all Moment technesch Ënnerstëtzung ubidden. Dir kënnt eis ruffen oder eng E-Mail un eis schreiwen.
Als éischt, klären d'Installatiounsbedéngungen:
a. Mëttel fir ze moossen;
b. Installatioun Plaz;
c. Miessunge Beräich;
d. Miessung Genauegkeet;
e. Sensor Resolutioun;
f. potenziell Interferenz;
g. Ob Schëffer Drock huet.
Wielt déi entspriechend Serie vu Produkter no dem Medium, a wielt dann de Produit gëeegent fir d'Konditiounen no der Range, Genauegkeet, Wénkel etc Parameteren.

Produkt Inspektioun ass a Preproduktiounsinspektioun gedeelt, wärend der Produktiounsinspektioun an der Pre-Sendung Inspektioun.
Pre-Produktioun Inspektioun
Virproduktioun Inspektioun soll am Ufank vun der Produktioun duerchgefouert ginn oder och virum Ufank vun der Fabrikatioun.
Eis Flichten
Préift Rohmaterialien a Komponenten déi an der Produktioun benotzt ginn;
Sample and test semi-finished products to detect potential defects;
Bewäert de Qualitéitssystem vun der Produktiounslinn;
Bewäert d'G
... 
Eis Flichten
Probéiert a bewäert d'Produkter fir Sécherheet, Leeschtung, Design, Funktioun an Erscheinung;
Préift fir Mängel an Ofwäichung vun de Spezifikatioune vu Clienten an / oder uginn Proben;
Bewäert d'Verpackungsmethoden a Verpackungsmaterial;
Préift a bewäert d'Qualitéitsmanagement vun der Produktiounslinn;
Evaluéiert de Produktiouns Fortschrëtt géint de Spillplang a virauszesoen ob d'Sendung am Zäitplang ass;
Gitt praktesch an effektiv Rotschléi fir d'Qualitéit am Aklang mat de Resultat
...
/ DIN40080 / NFX06-022, etc.
Eis Flichten
Préift Quantitéit, Accessoiren, Sortiment, Etikettéieren, Versandzeechen, etc. géint d'Akeef, uginn Proben an techneschen Dokumenter;
Sample and evaluate product for safety, design, function, appearance, and performance;
Préift fir Mängel an Ofwäichung géint d'technesch Normen oder Ufuerderungen;
Bewäerten Verpackungsform.
Är Virdeeler
Et ass déi lescht Inspektioun mat där Dir fäeg ass ze entscheeden de Charge / Lot vun der Wuer ze akzeptéieren oder net.

•Héich Dicht stierwen-goss Al, eenzegaarteg Struktur, Firma, corrosion Resistenz;
•Gutt geréiert Temperaturerhéijung tëscht internen an externen Deeler Och thermesch Verdeelungen;
•Méi héich Lumen Ënnerhalt Taux.IP66 waasserdicht fir Outdoor benotzen;
•Méi héich Drainage Effizienz a méi séier;
•UV-Beweis Optesch Lens Präzisioun Road Lighting Distributions;
•Outil-manner Ouverture vun Chauffer Këscht, einfach fir Ënnerhalt;
•Standard Lampearm Interface;
•Edelstahl Schrauwen gi benotzt fir ze verhënneren datt se falen.
